.page-search form{
    margin-top: 8px;
    margin-bottom: 16px;
    display: flex;
}
.page-search input {
    width: 350px;
    font-size: 16px;
    padding: 8px 30px;
    text-align: center;
    outline: none;
    border: none;
    border-radius: 4px;
    background-color: #eee;
    margin-left: 14px;
}
.page-search button {
    position: relative;
    top: 7px;
    left: -27px;
    outline: none;
    border: none;
    display: block;
    background-color: #eee;
}
.page-search button .icon.search {
    width: 20px;
    height: 20px;
}
.playList li{
    margin: 4px 16px;
    border-bottom: 1px solid #eee;
    cursor: pointer;
    display: flex;
    justify-content: space-between;
    align-items: center;
}
.playList li .item{
    display: flex;
    flex-direction: column;
}
.playList li .item span {
    width: 310px;
}
.playList li .item span:first-child {
    color: #1e6faa;
    font-weight: 500;
}
.playList li .item span:nth-child(2) {
    color: #757575;
    font-size: 10px;
}
.playList li .item span:nth-child(3) {
    font-size: 10px;
    color: #757575;
}
